import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://javier.rodriguez.org.mx/itesm/borregos/borrego-bluebg-1600.png" className="App-logo" alt="logo" />
        <p>
          Setup <code>ReactJs</code> para LDAW.
        </p>
        <a
          className="App-link"
          href="https://github.com/irvingpercam"
          target="_blank"
          rel="noopener noreferrer"
        >
          GitHub
        </a>
      </header>
    </div>
  );
}

export default App;
